        "description": "Alternatively titled, \"Physics Myth-Busters: why time dilation does NOT cause gravity\" this video explores an explanation of General Relativity whose monumental erroneousness is commensurate only to its popularity. What is this explanation, why is it so wrong, and how did so many high-profile YouTubers get suckered into promoting it? Prepare for a heavy dose of critical thinking, as we attempt to sift facts from falsehood and approach a deeper, more meaningful understanding of the actual nature of gravity. \n\nContents: \n00:00 - Introduction\n01:17 - Interpreting Curvature\n01:55 - The \"Time Dilation Causes Gravity\" Explanation \n04:00 - First Confusions\n05:30 - Distinctions between Gravity & Gravitational Attraction\n07:36 - The Problem of the Uniform Gravitational Field\n11:03 - \"Gravity\" at the Surface of the Earth\n13:30 - Spacetime Diagrams vs. Spacetime\n16:39 - Testing for Curvature\n19:19 - A Hidden Coordinate Transformation\n21:11 - The True Cause of Gravity\n24:09 - Planes of Simultaneity \n24:50 - We Need Your Help!",
